INSERT INTO `faq` (`id`, `question`, `answer`, `category`, `rowstate`, `insert`, `update`) VALUES
(1, 'What is profrea?', 'Profrea is a revolutionary platform where a doctor can establish their independent In-clinic as well as online practice without any capital investment & hassle of managing the clinics.', 'General', 1, '2020-05-02 06:24:30', '2022-04-04 11:56:04'),
(2, 'Do I need to do a profit sharing?', 'No, it\'s on a pay per use basis. Pay for what you use instead of paying traditional hefty rent. You can customize your plan as per your requirement.\n', 'General', 1, '2020-05-02 06:24:30', '2022-04-04 11:56:55'),
(3, 'How can I customize my plan?', 'Profrea gives you flexibility to choose your own no of hrs and days of practice. Do you want to practice only for two hrs. in a week or on a weekend or alternate days. Profrea enables it all. <br/>You can simply select a workspace and choose slots and days when you want to practice in a week. Book and have a happy practicing :-)\n\n', 'General', 1, '2020-05-02 06:24:30', '2022-04-07 05:03:57'),
(4, 'When do I need to pay?', 'Plan values are calculated on a monthly basis. You have to pay the full amount before joining the panel.', 'General', 1, '2020-05-02 06:24:30', '2022-04-04 11:58:33'),
(5, 'What all things I will get in Profrea clinics?\n', 'Profrea clinics are on plug and play concept for OPDâs i.e fully equipped with latest tech support with paperless policy, receptionist, helper, fully equipped cabins etc.\n', 'General', 1, '2020-05-02 06:24:30', '2022-04-04 11:59:06'),
(6, 'Can I use my own brand name?', 'Yes please, Profrea is just a tool to expand your practice. You can use your own name or your clinic\'s name whatever suits you to promote your practice.\n', 'General', 1, '2020-05-02 06:24:30', '2022-04-04 12:01:12'),
(7, 'Can I practice at different locations of the profrea clinics?\n', 'Yes, You can practice at different locations at the same time.\nWhat if my patient is requesting an appointment outside my booked slots in the clinic? <br/>You can check with your assigned workspace manager. In case the slots are available the same can be accommodated.\n', 'General', 1, '2020-05-02 06:24:30', '2022-04-04 12:02:00'),
(8, 'What if i need labs and test investigations for my patients?\n', 'Phlebotomist is available in all Profrea SmartClinics to facilitate your patients. We have partnered with accredited NABL labs as well for the home collection.\n', 'General', 1, '2020-05-02 06:24:30', '2022-04-04 12:02:28'),
(9, 'Is Profrea a marketing company?\n', 'No, we are just a tool to expand your practice. Although we facilitate you for your online listing, social media management and personalized website. \n<br/>\nWe do your branding in the clinic as well as in the facade area but we don\'t guarantee any patients.\n', 'General', 1, '2020-05-02 06:24:30', '2022-04-04 12:03:10');
